import React from 'react';
import './Results.css';

const Results = () => {
    return (
        <div className="results">
            <h3>Resultados</h3>
            <div className="results-container">
                <p>Aquí se mostrarán los resultados del análisis de los instrumentos musicales.</p>
                <div className="results-details">
                    <p>Ejemplo de resultado 1</p>
                    <p>Ejemplo de resultado 2</p>
                </div>
            </div>
        </div>
    );
};

export default Results;
